Animation_pt2::Animation_pt2(DMDFrame &dmd, SPIDMD &dmdbright, int width, int height) : dmd(dmd),
                                                                                        dmdbright(dmdbright),
                                                                                        width(width),
                                                                                        height(height)
{
}

// *********************************************************************************************
// effects

void Animation_pt2::drawPicture(int x, int y, bool *p, uint16_t rows, uint16_t cols, String style)
{
    width = dmd.width;
    height = dmd.height;
    if (style == "none")
    {
        for (uint16_t j = 0; j < cols; j++)
        {
            if (x + j >= 0 && x + j <= width)
            {
                for (uint16_t i = 0; i < rows; i++)
                {
                    if (y + i >= 0 && y + i <= height)
                    {
                        if (*(p + i * cols + j))
                            dmd.setPixel(x + j, y + i, GRAPHICS_ON);
                        else
                            dmd.setPixel(x + j, y + i, GRAPHICS_OFF);
                    }
                }
            }
        }
    }
    else if (style == "lines-to_right")
    {
        for (uint16_t j = 0; j < cols; j++)
        {
            if (x + j >= 0 && x + j <= width)
            {
                for (uint16_t i = 0; i < rows; i++)
                {
                    if (y + i >= 0 && y + i <= height)
                    {
                        if (*(p + i * cols + j))
                            dmd.drawLine(x + j, y + i, width, y + i, GRAPHICS_ON);
                        else
                            dmd.drawLine(x + j, y + i, width, y + i, GRAPHICS_OFF);
                    }
                }
            }
            delay(20);
        }
        for (uint16_t i = 0; i < height; i++)
            dmd.drawLine(x + cols, y + i, width, y + i, GRAPHICS_OFF);
    }
    else if (style == "lines-to_left")
    {
        for (uint16_t j = cols; j > 0; j--)
        {
            if (x + j - 1 >= 0 && x + j - 1 <= width)
            {
                for (uint16_t i = 0; i < rows; i++)
                {
                    if (y + i >= 0 && y + i <= height)
                    {
                        if (*(p + i * cols + j - 1))
                            dmd.drawLine(0, y + i, x + j - 1, y + i, GRAPHICS_ON);
                        else
                            dmd.drawLine(0, y + i, x + j - 1, y + i, GRAPHICS_OFF);
                    }
                }
            }
            delay(20);
        }
        for (uint16_t i = 0; i < height; i++)
            dmd.drawLine(-1, y + i, x - 1, y + i, GRAPHICS_OFF);
    }
    else if (style == "stack")
    {
        bool coll_pixels;
        for (uint16_t i = rows; i > 0; i--)
        {
            if (y + i - 1 >= 0 && y + i - 1 <= height)
            {
                for (uint16_t k = 0; k <= i - 1; k++)
                {
                    coll_pixels = false;
                    for (uint16_t j = 0; j < cols; j++)
                    {
                        if (x + j >= 0 && x + j <= width)
                        {
                            if (*(p + (i - 1) * cols + j))
                            {
                                coll_pixels = true;
                                dmd.setPixel(x + j, y + k, GRAPHICS_ON);
                                dmd.setPixel(x + j, y + k - 1, GRAPHICS_OFF);
                            }
                        }
                    }
                    if (coll_pixels)
                        delay(10);
                }
            }
        }
    }
    else if (style == "fall")
    {
        uint16_t j_temp;
        for (uint16_t i = rows; i > 0; i--)
        {
            if (y + i - 1 >= 0 && y + i - 1 <= height)
            {
                for (uint16_t j = 0; j < cols; j++)
                {
                    if (x + j >= 0 && x + j <= width)
                    {
                        if (i % 2 == 0)
                            j_temp = j;
                        else
                            j_temp = cols - j - 1;
                        for (uint16_t k = 0; k < i; k++)
                        {
                            if (*(p + (i - 1) * cols + j_temp))
                            {
                                dmd.setPixel(x + j_temp, y + k, GRAPHICS_ON);
                                dmd.setPixel(x + j_temp, y + k - 1, GRAPHICS_OFF);
                                delay(5);
                            }
                        }
                    }
                }
            }
        }
    }
    else if (style == "fall-queue") // not working
    {
        uint16_t j_temp;
        uint16_t pixel_array_x[rows];
        uint16_t pixel_array_y[rows];
        uint16_t pixel_array_len[rows];
        uint16_t l;
        for (uint16_t i = rows; i > 0; i--)
        {
            if (y + i - 1 >= 0 && y + i - 1 <= height)
            {
                for (uint16_t j = 0; j < cols; j++)
                {
                    if (x + j >= 0 && x + j <= width)
                    {
                        if (i % 2 == 0)
                            j_temp = j;
                        else
                            j_temp = cols - j - 1;

                        if (*(p + (i - 1) * cols + j_temp))
                        {
                            l = cols % i;
                            pixel_array_x[l] = x + j_temp;
                            pixel_array_y[l] = y + i - 1;
                            pixel_array_len[l] = 0;

                            for (uint16_t m = 0; m < i; m++)
                            {
                                dmd.setPixel(pixel_array_x[m], pixel_array_len[m], GRAPHICS_ON);
                                dmd.setPixel(pixel_array_x[m], pixel_array_len[m] - 1, GRAPHICS_OFF);

                                if (pixel_array_len[m] < pixel_array_y[m])
                                    pixel_array_len[m]++;
                            }
                            delay(10);
                        }
                    }
                }
            }
        }
    }
    else if (style == "expand-square")
    {
        uint16_t b = cols / 2;
        uint16_t a = rows / 2;
        while (b < cols || a < rows)
        {
            if ((x + b >= 0 && x + b <= width) || (y + a >= 0 && y + a <= height))
            {
                for (uint16_t j = cols / 2; j < b; j++)
                {
                    for (uint16_t i = rows / 2; i < a; i++)
                    {
                        if (*(p + i * cols + j))
                            dmd.setPixel(x + j, y + i, GRAPHICS_ON);

                        if (*(p + (rows - i - 1) * cols + j))
                            dmd.setPixel(x + j, y + (rows - i - 1), GRAPHICS_ON);

                        if (*(p + i * cols + (cols - j - 1)))
                            dmd.setPixel(x + (cols - j - 1), y + i, GRAPHICS_ON);

                        if (*(p + (rows - i - 1) * cols + (cols - j - 1)))
                            dmd.setPixel(x + (cols - j - 1), y + (rows - i - 1), GRAPHICS_ON);
                    }
                }
                delay(20);
            }
            if (b < cols)
                b++;
            if (a < rows)
                a++;
        }
    }
    else if (style == "invert")
    {
        for (uint16_t j = 0; j < cols; j++)
        {
            if (x + j >= 0 && x + j <= width)
            {
                for (uint16_t i = 0; i < rows; i++)
                {
                    if (y + i >= 0 && y + i <= height)
                    {
                        if (*(p + i * cols + j))
                            dmd.setPixel(x + j, y + i, GRAPHICS_OFF);
                        else
                            dmd.setPixel(x + j, y + i, GRAPHICS_ON);
                    }
                }
            }
        }
    }
    else if (style == "flip-x")
    {
        for (uint16_t j = 0; j < cols; j++)
        {
            if (x + j >= 0 && x + j <= width)
            {
                for (uint16_t i = 0; i < rows; i++)
                {
                    if (y + i >= 0 && y + i <= height)
                    {
                        if (*(p + i * cols + (cols - j - 1)))
                            dmd.setPixel(x + j, y + i, GRAPHICS_ON);
                        else
                            dmd.setPixel(x + j, y + i, GRAPHICS_OFF);
                    }
                }
            }
        }
    }
    else if (style == "flip-y")
    {
        for (uint16_t j = 0; j < cols; j++)
        {
            if (x + j >= 0 && x + j <= width)
            {
                for (uint16_t i = 0; i < rows; i++)
                {
                    if (y + i >= 0 && y + i <= height)
                    {
                        if (*(p + (rows - i - 1) * cols + j))
                            dmd.setPixel(x + j, y + i, GRAPHICS_ON);
                        else
                            dmd.setPixel(x + j, y + i, GRAPHICS_OFF);
                    }
                }
            }
        }
    }
}

