// effects

void Animation_pt2::fadingEffect()
{

    for (int j = 0; j < 2; j++)
    {
        for (int i = 255; i > 50; i--)
        {
            dmdbright.setBrightness(i);
            delay(20);
        }
        for (int i = 50; i < 255; i++)
        {
            dmdbright.setBrightness(i);
            delay(20);
        }
    }

    dmdbright.setBrightness(255);
}

void Animation_pt2::cleaningCurtain()
{
    width = dmd.width;
    height = dmd.height;
    for (int j = 0; j <= width / 2; j++)
    {
        for (int i = 0; i < height; i++)
        {
            dmd.setPixel(j, i, GRAPHICS_OFF);
            dmd.setPixel(width - j, i, GRAPHICS_OFF);
        }
        delay(10);
    }
}

void Animation_pt2::strokeLines_horizontal(int start_x, int start_y, int end_x, int stroke_width, int stroke_length, int stroke_gap)
{
    width = dmd.width;
    height = dmd.height;
    int s_total = stroke_length + stroke_gap;
    int s = 0;
    for (int i = start_x; i < end_x - 1; i++)
    {
        if (s < stroke_length)
        {
            for (int w = 0; w < stroke_width; w++)
            {
                if (i >= 0 && i < width && start_y + w >= 0 && start_y + w < height)
                    dmd.setPixel(i, start_y + w, GRAPHICS_ON);
            }
            s++;
        }
        else if (s < s_total)
        {
            for (int w = 0; w < stroke_width; w++)
            {
                if (i >= 0 && i < width && start_y + w >= 0 && start_y + w < height)
                    dmd.setPixel(i, start_y + w, GRAPHICS_OFF);
            }
            s++;
        }
        else
            s = 0;
    }
    for (int w = 0; w < stroke_width; w++)
    {
        if (end_x >= 0 && end_x < width && start_y + w >= 0 && start_y + w < height)
            dmd.setPixel(end_x, start_y + w, GRAPHICS_OFF);
    }
}

